                    <Grid item xs={12}>
                        {
                            <Paper className={classes.paperImage}>
                                <img alt={"homepage"} className={classes.homePageImg} src={homePageImg}></img>
                            </Paper>}
                    </Grid>
                    <Grid item sm={6} xs={12}>
                        <Paper className={classes.paperImage}>
                            test 1
                        </Paper>
                    </Grid>
                </Grid>
		</div>
        );
    }
}

Map.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Map);
